.searchPage {
    height: 100%;
    // 搜索框
        .search {
            display: flex;
            ::v-deep .el-input {
                width: 515px;
                height: 40px;

                .el-input__inner {
                    height: 100%;
                }

                .el-button {
                    width: 75px;
                    height: 40px;
                    font-size: 16px;
                    background: #84C22E;
                    color: #fff;
                }
            }
        }
        // tab
        ::v-deep .el-tabs {
            margin-top: 30px;
            .el-tabs__header {
                height: 30px;
                .el-tabs__nav-wrap {
                    height: 100%;
                    .el-tabs__nav-scroll {
                        height: 100%;
                        .el-tabs__nav {
                            height: 100%;
                            .el-tabs__item {
                                height: 100%;
                                line-height: 30px;
                            }
                        }
                    }
                }
            }
        }
        // 过滤条件
        .filterCondition {
            width: auto;
            margin-top: 16px;
        }
        // 列表
        .tableList {
            width: 100%;
            max-height: 475px;
            overflow: auto;
            margin-top: 16px;
            .itemList {
                margin: 0 0 10px;
                padding: 10px;
                border: 1px solid #E7E7E7;
                background: #fff;
                p {
                    display: flex;
                    align-items: center;
                    span {
                        width: 25%;
                        overflow: hidden;
                        text-overflow: ellipsis;
                        white-space: nowrap;
                    }
                }
                .topLine {
                    display: flex;
                    justify-content: space-between;
                    align-items: center;
                    .el-button {
                        margin-right: 20px;
                    }
                }
            }
        }
}
